def merge_lists(list1, list2):
    merged_list = [0] * max(len(list1), len(list2))

    for i in range(len(list1)):
        merged_list[i] += list1[i]
    for i in range(len(list2)):
        merged_list[i] += list2[i]
    return merged_list


