def plot_rl_reg():
    r1_coord = [(i, rl_out1[i]) for i in range(len(rl_out1))]
    r2_coord = [(i, rl_out2[i]) for i in range(len(rl_out2))]
    r3_coord = [(i, rl_out3[i]) for i in range(len(rl_out3))]
    r4_coord = [(i, rl_out4[i]) for i in range(len(rl_out4))]
    r5_coord = [(i, rl_out5[i]) for i in range(len(rl_out5))]
    r6_coord = [(i, rl_out6[i]) for i in range(len(rl_out6))]
    r7_coord = [(i, rl_out7[i]) for i in range(len(rl_out7))]
    r8_coord = [(i, rl_out8[i]) for i in range(len(rl_out8))]
    r9_coord = [(i, rl_out9[i]) for i in range(len(rl_out9))]
    r10_coord = [(i, rl_out10[i]) for i in range(len(rl_out10))]

    normal_coordinates = np.array(
        r1_coord + r2_coord + r3_coord + r4_coord + r5_coord + r6_coord + r7_coord + r8_coord + r9_coord + r10_coord)
    normal_coordinates = sorted(normal_coordinates.tolist())
    x = [normal_coordinates[i][0] for i in range(len(normal_coordinates))]
    y = [normal_coordinates[i][1] for i in range(len(normal_coordinates))]

    coef_normal = np.polyfit(x, y, 1)
    poly1d_fn_normal = np.poly1d(coef_normal)

    plt.plot(x, poly1d_fn_normal(x), '--', color="blue", linewidth=4, label="Normal RL Reg")


